function graphBar() {
    return ( 
        <div
          className="flex flex-col justify-center items-center" /* graph container day */
        >
          <div
            /* bar */ className="w-6 h-4 bg-terracotta-500 rounded-sm hover:bg-neptune-500"
          ></div>
          <span>tue</span>
        </div>
     );
}

export default graphBar;
